<template>
    <div>
        <img
            src="data:image/png;base64,"
            class="img-fluid"
            :id="id"
            @load="load"
        />
    </div>
</template>

<script>
export default {
    components: {},
    props: {
        id: {
            type: [String, Number],
            default() {
                return `img-${this._uid}`;
            }
        }
    },
    data() {
        return {
            width: null,
            height: null,
            isBusy: true
        };
    },
    methods: {
        load(e) {
            // this.isBusy = !this.isBusy;
            this.width = document.querySelector("#img-" + this._uid).width;
            this.height = document.querySelector("#img-" + this._uid).height;
            this.$emit("load");
        },
        /**
         * Convert coordinates based on image size
         * @param {String} coord Coordinates
         * @return {Array} Coordinates
         */
        convertCoord(coord) {
            const ratioX = this.getRatioX();
            const ratioY = this.getRatioY();

            let val = this.calculateCoord(coord, ratioX, ratioY);

            return val;
        },
        calculateCoord(coord, ratioX, ratioY) {
            return coord
                .split(",")
                .map((c, i) =>
                    i % 2 == 0 ? parseInt(c / ratioX) : parseInt(c / ratioY)
                );
        },
        getRatioX() {
            const orginalWidth = 790;
            return orginalWidth / this.width;
        },
        getRatioY() {
            const originalHeight = 319;
            return originalHeight / this.height;
        }
    },
    mounted() {}
};
</script>

